import { useState, useEffect } from "react";
import { Card, CardContent } from "./components/ui/card.js";
import { Input } from "./components/ui/input.js";

const API_URL = "https://script.google.com/macros/s/AKfycbyS6WZdHmwvWGZ-yI7GlXI3XSwNex1RzcZudVpk9hRNkGJYt_EIN7jfRoSnEaXkSfOC/exec";

export default function MaritimeTranslator() {
    const [entries, setEntries] = useState([]);
    const [newEnglish, setNewEnglish] = useState("");
    const [newChinese, setNewChinese] = useState("");

    useEffect(() => {
        fetch(API_URL)
            .then(response => response.json())
            .then(data => {
                setEntries(data.map(row => ({ english: row[0], chinese: row[1] })));
            })
            .catch(error => console.error("Fetch error:", error));
    }, []);

    return (
        <div className="p-4 w-full max-w-2xl mx-auto">
            <h1 className="text-2xl font-bold mb-4">Maritime Translator</h1>

            <Card>
                <CardContent className="p-4">
                    <div className="grid grid-cols-2 gap-2">
                        <div className="font-bold">English term</div>
                        <div className="font-bold">Chinese translation</div>
                    </div>
                    <div className="grid grid-cols-2 gap-2 mt-2">
                        {entries.map((entry, index) => (
                            <>
                                <div key={`${index}-english`} className="border p-2 rounded-md">
                                    {entry.english}
                                </div>
                                <div key={`${index}-chinese`} className="border p-2 rounded-md">
                                    {entry.chinese}
                                </div>
                            </>
                        ))}
                    </div>
                </CardContent>
            </Card>
        </div>
    );
}
